import React from 'react';
import { Link } from 'react-router-dom';

function Employers() {
  return (
    <div>
      <h1>Employers</h1>
      <Link to="/job-listing">Create/Edit Job Listing</Link>
      <Link to="/candidate-search">Search Candidates</Link>
      <Link to="/EmployerLogin">Search Candidates</Link>
    </div>
  );
}

export default Employers;
